import './CooperationBlock.scss';
import Subtitle from '../UI/Subtitle/Subtitle';
import { COOPERATION_INFO } from '../../data/cooperationInfo';

function CooperationBlock() {

    return (
      <div className="cooperationBlock">
        <div className="cooperationBlock__title">
            <Subtitle>
                {'Сотрудничество'}
            </Subtitle>    
        </div>
        <div className="cooperationBlock__info cooperationBlockInfo">
            <div className="cooperationBlockInfo__text">
                <p>
                    {COOPERATION_INFO.text}
                </p>
            </div>
            <div className="cooperationBlockInfo__image">
                <img src={COOPERATION_INFO.img.img} alt={COOPERATION_INFO.img.alt} />
            </div>
        </div>
      </div>
    );
  }

  export default CooperationBlock;
